import { FiBarChart2, FiDollarSign, FiGrid, FiPower, FiSettings, FiUser } from "react-icons/fi";
import logo_desktop from '../Components/Header/logo-white.svg'

class Config{

    // SITE INFO
    static siteTitle = "Elomie Info"
    static logo = logo_desktop
    static logoSm = "https://via.placeholder.com/80x"

    // PAGES URL
    static homePageUrl = "/";
    static loginPageUrl = "/login";
    static registerPageUrl = "/register";
    static profilePageUrl = "/profile";
    static forgetPageUrl = "/forget-password";
    static termsConditionPageUrl = "/terms-conditions";
    static privacyPolicyPageUrl = "/privacy-policy";
    static logoutPageUrl = "/logout";


    static sidebar_menu = [
        {
            id: 1,
            icon: <FiGrid />,
            title: "Dashboard",
            url: "/dashboard"
        },
        {
            id: 2,
            icon: <FiBarChart2 />,
            title: "Reports",
            url: "/products"
        },
        {
            id: 3,
            icon: <FiDollarSign />,
            title: "Earnings",
            url: "/earnings"
        },
        {
            id: 4,
            icon: <FiUser />,
            title: "Skills",
            url: "/skills"
        },
        {
            id: 4,
            icon: <FiSettings />,
            title: "Settings",
            url: "/settings"
        },
        {
            id: 5,
            icon: <FiPower />,
            title: "Logout",
            url: "/logout"
        }
    ]
}
export default Config;
